(function () {
	//大数相加,先解决数据的表达问题
	var str1='';
	var str2='';
	function addTwoNumber(str1,str2){
		let carry=0,l1=str1.length,l2=str2.length,arr =[];
		var maxLength =l1>l2?l1:l2; 
		for(var i=l1-1,j=l2-1,n=maxLength-1;n>=0;n--,i--,j--){
			var sum = (+str1[i]||0)+(+str2[j]||0)+carry;
			if(sum>=10){
				sum-=10;
				carry=1;
			}else{
				carry=0;
			}
			arr.unshift(sum);
		}
		if(carry > 0){
			arr.unshift(sum);
		}
		return arr.join("");
	}



	console.log(addTwoNumber(str1,str2));


	// console.log(num1+num2);
})();